#include "VRGame.h"
#include "StereoRender.h"

// Declare our game instance
VRGame game;

VRGame::VRGame()
    : _scene(NULL)
    , _stereoRender(nullptr)
    , _activeForm(nullptr)
{
}

void VRGame::initialize()
{
    // Load game scene from file
    _scene = Scene::create();
    
    float near = 0.1f;
    float far = 400.f;
    float fov = 85.f;
    auto camera = Camera::createPerspective(fov, Game::getInstance()->getAspectRatio(), near, far);
    _scene->setActiveCamera(camera);
    
    _stereoRender = new StereoRender();
    _stereoRender->initialize(nullptr, _scene);
    
    setDesiredFPS(40);
    
    unsigned char data[262144]; // 256 * 256 * 4
    char rgbaChar[2];
    int rgbaInt;
    for (int i=0; i < 262144; i++)
    {
        rgbaChar[0] = LOGO_PNG_DATA[i*2];
        rgbaChar[1] = LOGO_PNG_DATA[i*2 +1];
        sscanf(rgbaChar,"%x",&rgbaInt);
        data[i] = rgbaInt;
    }
    auto logoTexture = Texture::create(Texture::Format::RGBA, 256, 256, data);
    int winW = Game::getInstance()->getWidth();
    int winH = Game::getInstance()->getHeight();
    int logoW = logoTexture->getWidth() * 2;
    int logoH = logoTexture->getHeight() *2;
    //    displayScreen(this, &SphereVideoSurround::drawSplash, NULL, 1000L);
    auto theme = Theme::create("res/ui/default.theme");
    _activeForm = Form::create("form1", theme->getStyle("Form"));
    _activeForm->setSize(winW , winH);
    
    ImageControl* image = ImageControl::create("image", theme->getStyle("Image"));
//    image->setTexture(logoTexture);
    image->setWidth(logoW);
    image->setHeight(logoH);
    _activeForm->setEnabled(true);
    //_activeForm->setOpacity(0);
    image->setPosition((winW- logoW)/2, (winH-logoH)/2);
    SAFE_RELEASE(logoTexture);
    _activeForm->addControl(image);
    _activeForm->setSkinColor(Vector4(0, 0, 0, 1));
    SAFE_RELEASE(image);

}

int LOGON_VISITED = 0;
#define LOGON_MAXVISIT 35
void VRGame::finalize()
{
    SAFE_RELEASE(_scene);
    SAFE_RELEASE(_stereoRender);
    SAFE_RELEASE(_activeForm);
    LOGON_VISITED = 0;
}

void VRGame::update(float elapsedTime)
{

}

void VRGame::render(float elapsedTime)
{
    // Clear the color and depth buffers
    clear(CLEAR_COLOR_DEPTH, Vector4::zero(), 1.0f, 0);
        if(LOGON_VISITED >= 0 && LOGON_VISITED <= LOGON_MAXVISIT)
    {
        _activeForm->draw();
        LOGON_VISITED++;
    }
    else
    {
        LOGON_VISITED = -1;
    }
    
    if(LOGON_VISITED == -1 && _stereoRender)
    {
        _stereoRender->render(_scene);
        
    }
}

bool VRGame::drawScene(Node* node)
{
    // If the node visited contains a drawable object, draw it
    Drawable* drawable = node->getDrawable(); 
    if (drawable)
        drawable->draw(false);

    return true;
}

void VRGame::keyEvent(Keyboard::KeyEvent evt, int key)
{
    if (evt == Keyboard::KEY_PRESS)
    {
        switch (key)
        {
        case Keyboard::KEY_ESCAPE:
            exit();
            break;
        }
    }
}

void VRGame::touchEvent(Touch::TouchEvent evt, int x, int y, unsigned int contactIndex)
{
    switch (evt)
    {
    case Touch::TOUCH_PRESS:
        break;
    case Touch::TOUCH_RELEASE:
        break;
    case Touch::TOUCH_MOVE:
        break;
    };
}
